import React from 'react';
import styles from './SyncAnim.module.css'
function SyncAnim() {
    return (
                <span className={styles.SyncAnim}>

                    <span className={styles.n1}>s</span>
                    <span className={styles.n2}>y</span>
                    <span className={styles.n3}>n</span>
                    <span className={styles.n4}>c</span>
                </span>
    )
}

export default SyncAnim;
